import React from 'react';
import {
  ChakraProvider,
  Box,
  theme,
} from '@chakra-ui/react';
import Navbar from './components/Navbar.js';

import Form from './pages/form';

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Box fontSize="xl" justify='center' align='center' mt="20vh">
        <Navbar/>
        {/* <Form></Form> */}
        {/* <LoginForm></LoginForm>
        <SingupForm></SingupForm> */}
      </Box>
    </ChakraProvider>
  );
}

export default App;
